  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digital data
  describing the land use/land cover (mainly vegetation, but including water and urban
  environments) for the State of Louisiana at 1:100,000 scale. The map was compiled
  using Landsat 5 Thematic Mapper satellite imagery, botanical surveys, color infrared
  aerial photography, and existing coastal Louisiana habitat maps produced by the
  U.S. Fish and Wildlife Service's National Wetlands Inventory. Attribute fields describe
  the different land cover types occurring within the polygon or associated with each
  pixel.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
